    false,nt"url": null,nt"notes": "These market data provide a comprehensive
    set of measures of changes in economic activity throughout the coastal regions of
    the United States. In regard to the sources of data, establishments, employment,
    and wages are taken from the Quarterly Census of Employment and Wages (QCEW). The
    data series also is known as the ES-202 data. These data are based on the quarterly
    reports of nearly all employers in the United States. These reports are filed with
    each state's employment or labor department, and each state then transmits the data
    to the Bureau of Labor Statistics (BLS), where the national databases are maintained.
    The data for the Coastal Economies have been taken from the national databases at
    BLS (except in the case of Massachusetts). Gross State Product (GSP) data are taken
    from the Bureau of Economic Analysis (BEA), which develops the estimates of GSP
    from a number of sources. In regard to "employment", data are reported by employers,
    not employees, and does not contain any information about age. There is no difference
    between "employed" and "employment". The source is known as the payroll survey,
    a survey filed by employers every 3 months showing the number of people employed
    at each establishment in each of the preceding 3 months. Detailed information on
    the geographies the data are available for can be found here: https://coast.noaa.gov/data/digitalcoast/pdf/qrt-coastal-economy-description.pdf",nt"license_title":
